If a single module have 2 types of same name, consider doing something like this
```
import { User as IUserV1 } from "/nodejs-sdk/build/neynar-api/v1";
import { User as IUserV2 } from "/nodejs-sdk/build/neynar-api/v2";
```

I haven't worked with deno/bun specifically
but for node I think `package.json` is a good place 

{
    "engines" : {
        "node": ">=20.0.0"
    }
}
